using ObjectiveC;using System;using SwiftSharp.Attributes;using System.Collections.Generic;using Foundation;using CoreGraphics;namespace UIKit{    /// <summary>    /// An instance of the UIMenuItem class represents a custom item in the editing menu managed by the UIMenuController object.    /// </summary>    /// <see cref="https://developer.apple.com/library/prerelease/ios/documentation/UIKit/Reference/UIMenuItem_Class/index.html#//apple_ref/occ/cl/UIMenuItem"/>    [iOSVersion(3.2)]    public class UIMenuItem : NSObject//, AnyObject, NSObjectProtocol    {        /// <summary>        /// Creates and returns a menu-item object initialized with the given title and action.        /// </summary>        /// <param name="title">The title of the menu item.</param>        /// <param name="action">A selector identifying the method of the responder object to invoke for handling the command represented by the menu item.</param>        [iOSVersion(3.2)]        public UIMenuItem(string title, Selector action) { }                /// <summary>        /// The title of the menu item.        /// </summary>        [iOSVersion(3.2)]        [Export("title")]        public string Title { get; set; }                /// <summary>        /// A selector identifying the method of the responder object to invoke for handling of the menu command.        /// </summary>        [iOSVersion(3.2)]        [Export("action")]        public Selector Action { get; set; }    }}